      (+3.75779238e+00 + 3.72071237e-03 * T - 8.99017253e-07 * T2 +
       1.09522626e-10 * T3 - 5.27074196e-15 * T4 + 3.78111940e+02 * invT) *
      0.0322227234645872;
    // species 48: iC4H3
