      (+6.65385480e+00 + 5.60202750e-03 * T - 1.54671140e-06 * T2 +
       2.16966597e-10 * T3 - 1.14861124e-14 * T4 + 5.79543630e+04 * invT) *
      0.0195817341583771;
    // species 49: C6H4O2
    result +=
      y[49] *
      (+1.07308400e+01 + 1.18074975e-02 * T - 3.41152533e-06 * T2 +
       4.88304350e-10 * T3 - 2.54920440e-14 * T4 - 2.10857700e+04 * invT) *
      0.0092510361160450;
    // species 50: A2C11H20
    result +=
      y[50] *
      (+2.31243880e+01 + 2.67673100e-02 * T - 5.59078567e-06 * T2 +
       3.63507525e-10 * T3 + 2.72150880e-14 * T4 - 3.10691600e+04 * invT) *
      0.0065668074152389;
    // species 51: C6H5CO
    result +=
      y[51] *
      (+1.23744090e+01 + 1.19996445e-02 * T - 3.48857467e-06 * T2 +
       5.41728275e-10 * T3 - 3.60140900e-14 * T4 + 6.91478370e+03 * invT) *
      0.0095132995928308;
    // species 52: C5H5O(2,4)
    result +=
      y[52] *
      (+7.54053120e+00 + 1.14947550e-02 * T - 3.18125210e-06 * T2 +
       4.26540300e-10 * T3 - 1.94918720e-14 * T4 + 2.22636990e+04 * invT) *
      0.0123313685352800;
